[43643] = {description="Every day, there is a chance that speaking to Master Smith Helgar will offer a dialogue option, "Is there an axe the equal to Strom'kar?", which will end with being offered the quest Secrets of the Axes. When this quest is active, it is active region-wide, and everyone will have access to it for that day.\n\nThis sends you to speak to High Overlord Saurfang at Krasus' Landing in Dalaran. When done, jump back up to Skyhold and speak again to Master Smith Helgar, who will send you to the Circle of Wills to duel Saurfang.",providers={{"n",96586}}},
