[43682] = {description="You need to bring the Complete Copy of Nat Pagle's Fishing Guide and the Head of Nefarian for him to grant you this interaction.\n\nAlliance: Go to Western Plaguelands and talk to Alexia Ironknife.\n\nHorde: Go to Tirisfal Glades and talk to Bardu Sharpeye.",c={2},lvl=110,itemID=139620,sourceQuests={-91190},modID=1,q=1,b=1,f=50},
