[44339] = {description="Khadgar is located in the Violet Citadel in new Dalaran. On the left side, there is an NPC named Archivist Elysiana. Volume 1 is on the right-hand bookshelf behind her.\n\nWorld Spawn - might be on cooldown!",title="|cFFFFFFFFVolume I|r | The Violet Citadel in new Dalaran.",providers={{"n",113873}},coords={{30.6,50.8,627}}},
[44340] = {description="High Priestess Ishanah is on the other side of the alcove, and next to her is a Draenei Anchorite.\n\nWorld Spawn - might be on cooldown!",title="|cFFFFFFFFVolume II|r | Behind Juvess the Duskwhisperer in the Class Order Hall.",providers={{"n",111738}},coords={{58.4,25.1,702}}},
[44341] = {description="Book is on top of a bookshelf on the left side of the cloister, on the ground floor.\n\nWorld Spawn - might be on cooldown (60-minute respawn).",title="|cFFFFFFFFVolume III|r | New Hearthglen in Northrend.",icon="Interface\\Icons\\INV_Misc_Token_ScarletCrusade",coords={{72.2,73.4,115},{73.2,72.9,115}}},
[44342] = {description="You must get this volume first in order to collect the others.  Talk to Archivist Inkforge. Always choose the middle answer (passive curious, not judging) and he will give you the first volume.",title="|cFFFFFFFFVolume VI|r | Archivist Inkforge in the class order hall.",providers={{"n",111119}},coords={{62.5,36.3,702}}},
[44343] = {description="Enter Chillheart's room - you don't need to kill the boss. Kill the first trashpack on the right side. The book is on top of the 6th bookshelf from the right.",title="|cFFFFFFFFVolume V|r | Chillheart's room in Scholomance.",providers={{"n",58633}},coords={{69,72.9,22},{58.8,84,476}}},
[44344] = {description="On the left side of Meridelle Lightspark there is a shelf. On the lower board, there are some stacked books, and this volume is on the right side of those.\n\nWorld Spawn - might be on cooldown!",title="|cFFFFFFFFVolume IV|r | Bookshelf to the left of Meridelle Lightspark in the Class Order Hall.",providers={{"n",112401}},coords={{37.2,25,702}}},
[44345] = {description="Run through the instance to Flameweaver Koegler's room. on the left-hand side of the room there's a table with a candelabra. Volume 7 is on the bench between the table and the bookshelf.",title="|cFFFFFFFFVolume VII|r | The Flameweaver's library in Scarlet Halls.",providers={{"n",59150}},coords={{69,24.9,19},{35.7,14.2,432}}},
[44346] = {description="Fly to Shackle's Den and head east.\n\nIf several kill the mob, only one Priest is able to loot the book!",title="|cFFFFFFFFVolume XII|r | Chief Bitterbrine on the Queen's Reprisal in Azsuna.",providers={{"n",106990}},coords={{65.6,56.8,630}}},
[44347] = {description="You must kill him after you have at least one of the books in your inventory and he will drop the book.\n\nIf several kill the mob, only one Priest is able to loot the book!",title="|cFFFFFFFFVolume IX|r | Artificer Lothaire in Moon Guard Stronghold, Suramar.",providers={{"n",106351}},coords={{33.8,15,680}}},
[44348] = {description="After defeating the first boss, you will get into the Map-Room with a large setup in the middle. Head along the left side, the book is on one of the tables.",title="|cFFFFFFFFVolume X|r | Black Rook Hold in corner of room with ghosts and bookshelves.",providers={{"n",98542}},coords={{58.6,75.8,751},{38.4,50.8,641}}},
[44349] = {description="After the Curator, jump down to the right and head straight into the first nook. There is a tapestry on the wall and 3 bookshelves below. Volume 11 is on the bottom of the left-hand bookshelf.",title="|cFFFFFFFFVolume XI|r | Guardian's Library in old Karazhan.",providers={{"n",15691}},coords={{46.9,74.8,42},{36.8,37.9,358}}},
