[47207] = {model="305393",sourceQuests={45470},coords={{49.2,34,47}},objectID=209270,isWeekly=true,description="|cFFFFFFFFStep 2:|r This step will take us to |cFFFFD700Duskwood|r.  Head to |cFFFFFFFF49.25, 34.01|r.  |cFFFFD700Page 78|r is found on the table beside the moonwell. Click this to continue.  The page reads...\n\n|cFFFFFFFF...first of the lords to fall...|r"},
[47208] = {model="305393",sourceQuests={47207},coords={{47.3,78.1,198}},objectID=245216,isWeekly=true,description="|cFFFFFFFFStep 3:|r This step will take us to |cFFFFD700Firelands|r.  |cFFFFD700Page 161|r will be found on the left rear side of the |cFFFFD700Ragnaros|r platform.  Click this to continue.  The page reads...\n\n|cFFFFFFFF...the wind, the eye...|r"},
[47209] = {model="305393",sourceQuests={47208},coords={{70.4,78.1,249}},objectID=251564,isWeekly=true,description="|cFFFFFFFFStep 4:|r This step will take us to |cFFFFD700Uldum|r.  Head to |cFFFFFFFF70.44, 78.11|r.  |cFFFFD700Page 655|r will be between the two small trees.  Click this to continue.  The page reads...\n\n|cFFFFFFFF...the plume, the tomb, a scarab moon...|r"},
[47210] = {model="305393",sourceQuests={47209},coords={{72.4,44.3,390}},objectID=220821,isWeekly=true,description="|cFFFFFFFFStep 5:|r This step will take us to |cFFFFD700Siege of Orgrimmar|r.  This does not spawn on LFR.  Head to the |cFFFFD700Sha of Pride|r room.  |cFFFFD700Page 845|r is found in the far back left corner of the room (southwest on the minimap).  Click this to continue.  The page reads...\n\n|cFFFFFFFF...in snow, sand, and stone...|r"},
[47211] = {model="305393",sourceQuests={47210},isWeekly=true,coords={{22.9,64.4,75},{64.7,49.9,71}},objectID=220820,description="|cFFFFFFFFStep 6:|r This step will take us to the |cFFFFD700Well of Eternity|r instance in |cFFFFD700Caverns of Time|r.  Kill the first 2 bosses.  Take the drake and when you are dropped off walk to the left to the stone stairs.  |cFFFFD700Page 1127|r will be on the bottom stair next to a large stone divider.  Click this to continue.  The page reads...\n\n|cFFFFFFFF...behold the battle, unblinking...|r"},
[47212] = {model="305393",sourceQuests={47211},coords={{34.6,50.9,379}},objectID=19023,isWeekly=true,description="|cFFFFFFFFStep 7:|r This step will take us to |cFFFFD700Kun-Lai Summit|r near the |cFFFFD700Shado-Pan Monastery|r.  Head to |cFFFFFFFF34.61, 50.88|r.  |cFFFFD700Page 2351|r will be between the statue's paws on the platform.  Click this to continue.  The page reads...\n\n|cFFFFFFFF...bejeweled watcher...|r"},
[47213] = {model="305393",sourceQuests={47212},coords={{76.4,53.6,249}},objectID=244678,isWeekly=true,description="|cFFFFFFFFStep 8:|r This step will take us to |cFFFFD700Uldum|r.  Head to |cFFFFFFFF76.45, 53.67|r.  |cFFFFD700Page 5555|r will be on the platform slightly offcenter in front of the left foot of the statue.  Click this to continue.  The page reads...\n\n|cFFFFFFFF...ray of sunshine...|r"},
