[47826] = {description="|cFFFFFFFFStep 1:|r Go to |cFFFFFFFF50.6, 54.1|r in Broken Isles Dalaran.  On the second floor of |cFFFFD700Curiosities & Moore|r you will see a table with three chairs.  An |cFFFFD700Inconspicuous Note|r will be on the table.  Click it.  The note reads...\n\n|cFFFFFFFFIt begins in the 2104059.|r\n|cFFFFFFFFWith a most pleasing sign.|r\n|cFFFFFFFF(These letters will not always rhyme.)|r\n",coords={{50.6,54.1,627}},objectID=270855,model="1661948"},
