[47844] = {isWorldQuest=true,lvl=110},
[47849] = {model="985300",sourceQuests={47841},objectID=272163,coords={{63.7,22.6,207},{58.3,25.6,207}},description="|cFFFFFFFFStep 5:|r First, obtain a |cFFFFD700Shadoweave Mask|r.  |cffcc33ffNote: You will need the actual item; it cannot be transmogged on your character.|r\n\nThis step requires visiting Deepholm.  Take the |cFFFFD700Therazane's Throne|r portal if it is available; otherwise, fly to |cFFFFFFFF58.3, 25.6|r and you will see a cave opening to |cFFFFD700Crumbling Depths|r.\n\nOnce you are in the cave, mount up and go past the |cFFFFD700Colossal Gyreworm|r into the next section of the cavern. Go to the big grey rock in the center of the room at |cFFFFFFFF63.7, 22.6|r and you will see a |cFFFFD700Dark Fissure|r.  Click it.  Once you click it, a warning will pop up, saying: \n\n|cffcc33ff'WARNING: you are about to fall into a dark fissure.  You may not be able to climb back out again.  Are you very sure you want to do this?'|r\n\nOnce inside the fissure, you will see a chair.  Go behind the chair and click on the |cFFFFD700Dingy Plaque|r.  The plaque reads... \r\r|cFFFFFFFFSupremacy?|r\r|cFFFFFFFFGet...|r\r|cFFFFFFFFShirk...|r\r|cFFFFFFFF...eke...|r\r\rThis will spawn a |cFFFFD700Strange Skull|r on the seat of the chair.  Equip the Shadoweave Mask and interact with the |cFFFFD700Strange Skull|r and you will see a purple explosion.|r\n"},
[47850] = {description="|cFFFFFFFFStep 6:|r The next |cFFFFD700Inconspicuous Note|r spawns in front of the chair.  Click it.  The note reads...\r\r|cFFFFFFFFWhere the shaded delegate may appear.|r\n",sourceQuests={47849},objectID=272165,model="1661948"},
[47851] = {providers={{"n",111243}},coords={{57.2,67.5,627}},isWeekly=true},
[47852] = {model="1661948",sourceQuests={47850},coords={{30.11,74.64,30}},objectID=272172,description="|cFFFFFFFFStep 7:|r This step requires visiting |cFFFFD700Gnomeregan|r. \n\nNote: Horde players can easily get to Gnomeregan by taking the zeppelin from Orgrimmar and using the teleporter at Grom'gol Base Camp.  Players of either faction who have done the Gnomeregan pet battle dungeon can be teleported there directly by speaking to |cff006812Manapoof|r in Broken Isles Dalaran or their BfA capital city.\n\nOnce inside the instance, go straight and jump down into the |cFFFFD700Hall of Gears|r.  From here, take the winding hallway towards the |cFFFFD700Launch Bay|r.  About halfway between the |cFFFFD700Launch Bay|r and |cff863325Crowd-Pummeler 9-60|r, there will be a plaque on the wall called |cFFFFD700Instructions|r and a set of 10 |cFFFFD700Numerical Consoles|r.  Click the Instructions.  They read:\n\n|cFFFFFFFF0111011 00100 10010110 1010|r\n|cFFFFFFFF11110111 01100 01111111 01000|r\n|cFFFFFFFF01101011100101 1010010110 10111101|r\n|cFFFFFFFF11001 00111111 10010 01001001|r\n|cFFFFFFFF10000 011010010110100111010110|r\n|cFFFFFFFF01011011 11110 11110001 11111|r\n|cFFFFFFFF11100000 00010 11111111 01000|r\n|cFFFFFFFF10110111 10101 01111111 00001|r\n|cFFFFFFFF10101110 11111 00110000 01000|r\n|cFFFFFFFF101101010010101110010110|r\n\n|cFFFFFFFF180|r\n\n|cFFFFFFFF+1111111111|r\n\nSetting the consoles to |cFFFFFFFF1222176597|r will cause the fifth |cFFFFD700Inconspicuous Note|r to spawn.\n\n|cffcc33ffNote: You can use the following scripts as macros for 'up' and 'down,' respectively:|r\n|cffcc33ff/script SelectGossipOption(1)|r\n|cffcc33ff/script SelectGossipOption(2)|r\n\nClick it.  The note reads...\n\n|cFFFFFFFFGames and toys are left behind.|r\n|cFFFFFFFFWhen you awaken screaming.|r\n"},
