[52898] = {model="367326",modelScale=0.5,objectID=294098,coords={{53.5,10.8,542}},description="Spires of Arak\n\nUnderwater on top of the large rock.  \n\nThe Tiny Frog says:\n\n"<Something is written here.>\n\nDog wig moss?"",sourceQuests={52831}},
[52899] = {model="774346",modelScale=0.5,objectID=294099,coords={{33.6,58.2,105}},description="Blades Edge Mountains\n\nOn the ground next to a crystal.  \n\nThe Brittle Bone reads:\n\n"<Something is written here.>\n\nRage, Shank Sever"",sourceQuests={52898}},
[52900] = {model="1307043",objectID=294100,coords={{67.9,41,542}},description="Spires of Arak\n\nNext to a large candle. \n\nThe Misplaced Candle reads:\n\n"<Something is written here.>\n\nRankest Goldfish"",sourceQuests={52899}},
[52901] = {model="1822968",modelScale=0.5,objectID=294101,coords={{45.7,26.2,539}},description="Draenor SMV\n\nBrown cup, next to the fire. \n\nThe Odd Cup reads:\n\n"<Something is written here.>\n\nEase off fruit..."",sourceQuests={52900}},
[52902] = {model="939054",modelScale=0.5,objectID=294102,coords={{51.6,43.8,104}},description="Outland SMV\n\nOn top of the mountain.\n\nThe Interesting Rock reads:\n\n"<Something is written here.>\n\nThe BIG Bull"",sourceQuests={52901}},
[52903] = {model="343460",objectID=294103,coords={{58,31.6,51}},description="Swamp of Sorrows\n\nUnder the tree, on top of the water.\n\nThe Blooming Lily reads:\n\n"<Something is written here.>\n\nJaws open nooks!"",sourceQuests={52902}},
[52904] = {model="1124095",modelScale=0.5,objectID=294104,coords={{24,78,23}},description="Eastern Plaguelands\n\nInside the crypt, on top of the sarcophagus lid\n\nThe Pretty Flower reads:\n\n"<Something is written here.>\n\nDead Rune Thug"",sourceQuests={52903}},
[52905] = {model="244161",modelScale=0.5,objectID=294105,coords={{41.2,78.9,42}},description="Deadwind Pass\n\nInside the old church, near the table.\n\nThe Old Book reads:\n\n"<Something is written here.>\n\n...A Stage Deception"",sourceQuests={52904}},
[52906] = {model="189087",modelScale=0.5,objectID=294106,coords={{21,38.2,36},{77.9,44.3,33}},description="Blackrock Mountain\n\nRoom next to LBRS entrance, next to the fire.\n\nThe Dead Fish says:\n\n"<Something is written here.>\n\nNecropolis Expos!"",sourceQuests={52905}},
[52907] = {model="625180",modelScale=3,objectID=294107,coords={{52,62.4,47}},description="Duskwood\n\nUnderneath the large plank.\n\nThe Scratched Board reads:\n\n"<Something is written here.>\n\nThe net saves."",sourceQuests={52906}},
[52908] = {model="242730",objectID=294108,coords={{44.6,26.4,25}},description="Hillsbrad Foothills\n\nJust inside the clocktower, left pile of bones.\n\nThe Lost Ring reads:\n\n"<Something is written here.>\n\nTerrible grunt."",sourceQuests={52907}},
[52909] = {model="960844",modelScale=0.5,objectID=294109,coords={{90.1,37.9,15}},description="Badlands\n\nInside the larger building, on the table, next to the roasted boar.\n\nThe Spoiled Apple reads:\n\n"<Something is written here.>\n\nLeave Nets, Often"",sourceQuests={52908}},
[52910] = {model="442505",objectID=294110,coords={{36.8,27.6,17}},description="Blasted Lands\n\nBase of the statue, near a candle.  The tooth is present in both the past and present.\n\nThe Broken tooth reads:\n\n"<Something is written here.>\n\nBrash remains."",sourceQuests={52909}},
[52911] = {model="197882",modelScale=0.5,objectID=294111,coords={{27.1,47,36}},description="Burning Steppes\n\nEquipped on the larger brown skeletons head.\n\nThe Worn Helm reads:\n\n"<Something is written here.>\n\nSensed the Figs..."",sourceQuests={52910}},
[52912] = {model="523642",modelScale=2,objectID=294112,coords={{42.75,20.18,125}},description="Northrend Dalaran\n\nIn front of the left planter.\n\nThe Leafy Leaf reads:\n\n"<Something is written here.>\n\nPhantasmal Hosts?"",sourceQuests={52911}},
[52913] = {model="1360796",objectID=294113,coords={{40.2,72.5,108}},description="Terrokar Forrest\n\nInside the crate, inside the tent, near the Shadow Labs entrance.\n\nThe Musty Cloth reads:\n\n"<Something is written here.>\n\nScarce odds, still."",sourceQuests={52912}},
[52914] = {model="202596",modelScale=2,objectID=294114,coords={{17.1,57.9,241}},description="Twilight Highlands\n\nOn the ground next to the mace.\n\nThe Broken Tablet reads:\n\n"<Something is written here.>\n\nStarfish droplets!"",sourceQuests={52913}},
[52915] = {model="341882",modelScale=2,objectID=294115,coords={{60.8,67.8,69}},description="Feralas\n\nMiddle of the remains and table, sticking out of the ground.\n\nThe Ashed Torch reads:\n\n"<Something is written here.>\n\n...a daft tormenter's fog."",sourceQuests={52914}},
[52916] = {model="305392",modelScale=0.5,objectID=294312,coords={{38.2,90.1,14},{85.4,73.6,14}},description="Head to the past version of Arathi Highlands, and click on the note on the table inside Grimmy's house.\n\nGrimmy's List of Friends reads:\n\n"List of My Friends?\nFirst is SN, you always smelled so good\nSecond is TM, you smelled like burning\nwood\nThird is FD, though you smelled like fel\nLast is OM, I hated that fishy smell"",sourceQuests={52915}},
[52917] = {description="Equip the Windwool Hood, Deathsilk Shoulders, Netherweave Tunic, and Frostwoven Leggings, and talk to Grimmy.  Select his dialogue "It's me, your friend. Got any secrets to tell me about?"",providers={{"n",138578}},sourceQuests={52916}},
[52918] = {model="305391",objectID=294314,description="After selecting the Grimmy dialogue, a note appears on his bedstand.  Click it.  Grimmy's List of Enemies reads:\n\n"You flaunted your virility, and red was\nnever to my liking\nThough I wanted to slap you, I always\nfound you striking.\n\nYou Always though you knew what was\nbest, but not everyone likes greens,\nThough I waved your way, I pictured\nyour shredded hide in my dreams.\n??\nYour bread was bad, you diseased lout,\nit made me sick.\nI woudl cheerily beat you with a stick.\n??\nLast you, I'm not eve going to think of\na rhyme for you, Mugs.\nI will dance on your grave, you were\nuniquely terrible."\n\nGo to each of the following npc's with Proximo's Rudius, Rough Wooden Staff, Punctured Pelt, and Formula: Enchant Ring - Striking, and emote to them.",sourceQuests={52917}},
[52919] = {description="Return to Grimmy and select his new dialogue\n\n"I've sent some messages to your enemies, now about those secrets..."",sourceQuests={52822,52823,52824,52826},coords={{85.3,73.6,14}},npcID=138578},
[52920] = {model="936411",modelScale=0.5,objectID=294315,description="After selecting Grimmy's dialogue, a new note appears by the fireplace.  Click it.  Grimmy's Favorite Recipe reads:\n\n"A pinch of turmeric and a pound of salt,\nif it comes out poorly it's your own\nfault.\n\nPay attention to the broth, and stir,stir,\nstir!\nThen add a big handful of boar fur.\n\nLast you need a little sour,\nget the kick with a little gunpowder!"",sourceQuests={52919}},
[52921] = {model="2020463",modelScale=0.5,objectID=294335,coords={{88.4,69.2,14}},description="Go outside and find the Rotten Potato.  You will need to get exactly 144 stacks of Rotten Potato by clicking the potato.  After getting 144 stacks of the buff, go back and talk to Grimmy and select his new dialogue option"How do I smell?"\n\nGrimmy's new dialogue says:\n\n"Oh, my, just like my mother used to after she made her famous pie.\n\nVery well, I will show you...my life's work!\n\nIt's in the chest out back, and it's all yours!\n\nI hope it was worth it!"",sourceQuests={52920}},
[52922] = {model="196989",objectID=294703,coords={{85.1,73.3,14}},description="After asking Grimmy how you smell, go outside behind and above his house, and on the hill will be Grimmy's Rusty Lockbox waiting for you to open it.",sourceQuests={52921}},
